  \"2016-08-06T14:12:22.577232\",\n\t\"name\": \"master-street-name-table\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This list is a work-in-progress and will
  be updated at least quarterly. This version updates column names and corrects spellings
  of several streets in order to alleviate confusion and simplify street name research.
  It represents an inventory of official street name spellings in the City of New
  Orleans. Several sources contain various spellings and formats of street names.
  This list represents street name spellings and formats researched by the City of
  New Orleans GIS and City Planning Commission.rnrnNote: This list may not represent
  what is currently displayed on street signs. City of New Orleans official street
  list is derived from New Orleans street centerline file, 9-1-1 centerline file,
  and CPC plat maps. Fields include the full street name and the parsed elements along
  with abbreviations using US Postal Standards. We invite your input to as we work
  toward one enterprise street name list.rnrnStatus: rnCurrent: Currently a known
  used street name in New Orleans rnOther: Currently a known used street name on a
  planned but not developed street. May be a retired street name.\",\n\t\"license_title\":
